var jrQrcode = require('../dist/jr-qrcode.js');

describe('getQrBase64', function () {
    it('empty text', function () {
    	var data = jrQrcode.getQrBase64('', {
	        padding     : 10,   //二维码四边空白，默认为10px
		    width       : 256,  //二维码图片宽度，默认为256px
		    height      : 256,  //二维码图片高度，默认为256px
		    correctLevel    : QRErrorCorrectLevel.H,    //二维码容错level，默认为高
		    background      : "#ffffff",    //二维码颜色
		    foreground      : "#000000"     //二维码背景颜色
	    });
        assert.strictEqual(data, 'data:image/png;base64,');
    });
	it('text is "hello jrQrcode"', function () {
		var data = jrQrcode.getQrBase64('hello jrQrcode', {
	        padding     : 10,   //二维码四边空白，默认为10px
		    width       : 256,  //二维码图片宽度，默认为256px
		    height      : 256,  //二维码图片高度，默认为256px
		    correctLevel    : QRErrorCorrectLevel.H,    //二维码容错level，默认为高
		    background      : "#ffffff",    //二维码颜色
		    foreground      : "#000000"     //二维码背景颜色
	    });
        assert.strictEqual(data, 'data:image/png;base64,');
    });
	it('text is "中文"', function () {
		var data = jrQrcode.getQrBase64('中文', {
	        padding     : 10,   //二维码四边空白，默认为10px
		    width       : 256,  //二维码图片宽度，默认为256px
		    height      : 256,  //二维码图片高度，默认为256px
		    correctLevel    : QRErrorCorrectLevel.H,    //二维码容错level，默认为高
		    background      : "#ffffff",    //二维码颜色
		    foreground      : "#000000"     //二维码背景颜色
	    });
        assert.strictEqual(data, 'data:image/png;base64,');
    });
	it('text is "http://m.pp.cn/home.html?debug=dev#footer"', function () {
		var data = jrQrcode.getQrBase64('http://m.pp.cn/home.html?debug=dev#footer', {
	        padding     : 10,   //二维码四边空白，默认为10px
		    width       : 256,  //二维码图片宽度，默认为256px
		    height      : 256,  //二维码图片高度，默认为256px
		    correctLevel    : QRErrorCorrectLevel.H,    //二维码容错level，默认为高
		    background      : "#ffffff",    //二维码颜色
		    foreground      : "#000000"     //二维码背景颜色
	    });
        assert.strictEqual(data, 'data:image/png;base64,');
    });
});
